import React, { useState } from 'react';
import { render } from 'react-dom';

import TimeRange from '../../components/TimelineSlider/App';
import { format } from 'date-fns';
import {
  selectedInterval,
  disabledIntervals,
  timelineInterval,
} from './datesSource';

const Split = () => (
  <div>
    <div
      style={{
        width: '80vw',
        /* height: '80vh', */
        margin: '24px auto',
        background: '#fff',
        borderRadius: '20px',
      }}
    >
      캔버스 영역
    </div>
    <div
      style={{
        padding: '16px',
        /* height: '20vh', */
        background: '#fff',
        overflowX: 'scroll',
      }}
    >
      <div className="container">
        <TimeRange disabledIntervals={disabledIntervals} />
      </div>
    </div>
  </div>
);

export default Split;
